function initMaps() {
  var map;

  for (var i in mapsMyMaps) {
    map = new google.maps.Map(document.getElementById("map-" + i), {
      zoom: mapsMyMaps[i].zoom,
      center: mapsMyMaps[i].latLng,
      disableDefaultUI: true,
      zoomControl: false,
      scaleControl: false,
      scrollwheel: false,
      disableDoubleClickZoom: true
    });

    var myMapsId = mapsMyMaps[i].mid;

    new google.maps.KmlLayer({
      map: map,
      preserveViewport: true,
      url: 'https://www.google.com/maps/d/kml?cache=' + Date.now() + '&mid=' + myMapsId,
    });
  }

  for (i in mapsGMaps) {
    map = new google.maps.Map(document.getElementById("map-" + i), {
      center: mapsGMaps[i].latLng,
      zoom: mapsGMaps[i].zoom,
      disableDefaultUI: true,
      zoomControl: false,
      scaleControl: false,
      scrollwheel: false,
      disableDoubleClickZoom: true
    });

    var marker = new google.maps.Marker({
      position: mapsGMaps[i].latLng,
      map: map
    });
  }
}



