app.factory('GCSE', function ($http) {
  var cachedSearch = {};

  return {
    searchRequest: function (params) {
      args = JSON.stringify(params);

      var request;

      if (cachedSearch[args]) {
        request = cachedSearch[args];
      }
      else {
        request = $http({
          "method": "GET",
          "url": drupalSettings.path.baseUrl + "search-api/v1",
          "params": params
        });
        cachedSearch[args] = request;

        if (typeof ga == 'function') {
          if (params.q) {
            ga('send', 'pageview', '?q=' + params.q);
          }
        }
      }

      return request.then(function (result) {
        if (result && result.data && result.data.searchInformation) { //available search results
          return result;
        } else {
          if (typeof ga == 'function') {
            ga('send', 'event', 'Error Retrieving Search Results from GCSE', 'params: ' + args);
          }
          return result;
        }
      });
    }
  }
});


