app.filter('trustAsResourceUrl', ['$sce', function ($sce) {
  return function (val) {
    return $sce.trustAsResourceUrl(val);
  };
}]);

app.filter('to_trusted', ['$sce', function ($sce) {
  return function (text) {
    return $sce.trustAsHtml(text);
  };
}]);

app.filter('unAmp', function () {
  return function (text) {
    return text.replace("&amp;", "&");
  };
});

/* modified from: http://stackoverflow.com/questions/17289448/angularjs-to-output-plain-text-instead-of-html */
app.filter('to_plain', function () {
  return function (text) {
    return text ? String(text).replace(/<[^>]+>/gm, '') : '';
  };
});

app.filter('replace', function () {
  return function (text, find, replacement) {
    if (text && find && replacement) {
      return text.replace(find, replacement);
    }
  };
});

app.filter('viewFilter', function () {
  return function (items, field, val) {
    var filtered = [];
    for (var i = 0; i < items.length; i++) {
      var item = items[i];
      if (item[field] == val || val === '') {
        filtered.push(item);
      }
    }
    return filtered;
  };
});

/* http://justinklemm.com/angularjs-filter-ordering-objects-ngrepeat/ */
app.filter('orderObjectBy', function () {
  return function (items, field, reverse) {
    var filtered = [];
    angular.forEach(items, function (item) {
      filtered.push(item);
    });
    filtered.sort(function (a, b) {
      return (a[field] > b[field] ? 1 : -1);
    });
    if (reverse) filtered.reverse();
    return filtered;
  };
});

app.filter('orderObject', function () {
  return function (items, reverse) {
    var filtered = [];
    angular.forEach(items, function (item) {
      filtered.push(item);
    });
    filtered.sort(function (a, b) {
      return (a > b ? 1 : -1);
    });
    if (reverse) filtered.reverse();
    return filtered;
  };
});

/* http://stackoverflow.com/questions/17289448/angularjs-to-output-plain-text-instead-of-html */
app.filter('orderByPlain', function () {
  return function (items, field) {
    var filtered = [];
    var reverse = (field.charAt(0) == "-") ? 1 : 0;

    field = field.replace(/^-/, '');

    function htmlToPlaintext(text) {
      return text ? String(text).replace(/<[^>]+>/gm, '') : '';
    }

    angular.forEach(items, function (item) {
      filtered.push(item);
    });
    filtered.sort(function (a, b) {
      return (htmlToPlaintext(a[field]) > htmlToPlaintext(b[field]) ? 1 : -1);
    });
    if (reverse) filtered.reverse();
    return filtered;
  };
});

app.filter('firstLetterOf', function () {
  return function (input, variable, letter) {
    if (letter == "" || letter == "All") {
      return input;
    }
    else {
      input = input || [];
      var filtered = [];
      input.forEach(function (item) {
        if (item[variable].charAt(0).toLowerCase() == letter.toLowerCase()) {
          filtered.push(item);
        }
      });
      return filtered;
    }
  };
});

app.filter('beginWithAlphaString', function () { //returns string that begins with A-z only
  return function (item) {
    var string = null;
    var regExp = new RegExp('[a-z]', 'i');

    if (regExp.test(item.charAt(0))) { // check first char
      string = item.toUpperCase();
    } else { // not valid char
      for (var s = 1; s < item.length; s++) {
        if (regExp.test(item.charAt(s))) { //trim starting from first alpha index
          string = item.substring(s).toUpperCase();
          break;
        }
      }
    }

    return string;
  }
});

