app.factory('ProfileUNI', function($http) {
  var Feed = $http.get(drupalSettings.path.baseUrl + 'json/profile-uni?_format=json');

  return {
    getFeed: function() {
      return Feed.then(function(result) {
        return result.data;
      });
    }
  }
});

app.directive("profileLookup", ['ProfileUNI', '$filter', function(ProfileUNI, $filter){
  return {
    restrict : "A",
    transclude: true,
    scope: {
      uni: '@'
    },
    link: function (scope, element, attrs) {
      ProfileUNI.getFeed().then(function(data) {
        scope.match = '';
        scope.data = data;

        if (scope.uni != "" && scope.uni != "NONE") {
          scope.match = $filter('filter')(data, {uni: scope.uni});
        }
      });
    },
    template: '<div ng-switch on="match.length || \'null\'">' +
      '<div ng-switch-when="null">' +
        '<ng-transclude></ng-transclude>' +
      '</div>' +
      '<div ng-switch-default>' +
        '<a href="{{ match[0].path }}"><ng-transclude></ng-transclude></a>' +
      '</div>' +
    '</div>'
  };
}]);;
